Desc from Creator:
&quot;You guys asked for her and you guys got her: Nadia! This was my first attempt at a home made video so please be kind in dealing with the VHS quality and the sound of the fan in the bathroom. I think you'll agree that Nadia, my ex-wife, was a hot young thing in her prime. When she left, she took everything we made, erased my hard drive, but she forgot about the original (thank god for 70's and 80's technology). Well, thanks to that you guys get to enjoy the fruits of my labor. Take a look at the screencaps to check out the action and to see what Nadia looked like at the turn of the century, and then check out what she looks like today. I think you'll agree that her best days are behind her.&quot;
